import React, {useContext, useEffect, useState} from 'react';
import {observer} from "mobx-react-lite";
import ContactItem from "../Components/ContactItem";
import ModalState from "../Components/ModalState";
import {getAllContacts} from "../HTTP/contactAPI";
import {Contact} from "../Store/ContactsStore"
import {Context} from "../index";
const Account = observer(() => {

    const {us, con}:any = useContext(Context);
    useEffect(()=>{
        getAllContacts(us.User.token).then((data)=>{
            console.log(data);
            con.setContact(data.rows)
            console.log(con.Contact)
        })
    })
    return (
        <>
            <div className={'accountPage'}>
                <div className={'account '}>
                    {con.Contact.map((contact:Contact) =>

                        <ContactItem key={contact.id} contact={contact}/>

                    )}
                    <ModalState/>
                </div>
            </div>

        </>
    );
});

export default Account;
